define("ace/mode/dl_worker",[], function(require, exports, module) {
"use strict";

var oop = require("../lib/oop");
var Mirror = require("../worker/mirror").Mirror;
var parseArchive = require("./dl/dl-parser").parseArchive

var Worker = exports.Worker = function(sender) {
    Mirror.call(this, sender);
    this.setTimeout(250);
};

oop.inherits(Worker, Mirror);

(function() {

    this.onUpdate = function() {
      var value = this.doc.getValue();
      var errors = [];
      var results = parseArchive(value);

      for (var i = 0; i < results.length; i++) {
        var error = results[i];
        errors.push({
          row: error.line-1,
          column: error.column,
          endRow: error.endLine-1,
          endColumn: error.endColumn,
          text: error.message + "; expected '" + error.expect + "', but found '" + error.found + "'",
          type: "error" // |"warning"|"info"
        });
      }
      this.sender.emit("annotate", errors);
    };

}).call(Worker.prototype);

});
